import React, { useState } from "react";
import { Form } from "react-bootstrap";

function TechnicalShowcase(){

    const [Tech, setTech] = useState([]);

    const onUpdate = (data) => {
        setTech(...Tech,{[data.target.value]:data.target.value})
    } 
    return(
        <div>
            <Form className="appraisal form">
            <div>
              <label htmlFor="reusablelibraries">Reusable Libraries</label>
              <textarea id="reusablelibraries" rows={5} cols={5} onChange={(e)=>onUpdate(e.target.value)} />
            </div>
            <div>
              <label htmlFor="techtalk">Tech Talks</label>
              <textarea id="techtalk" rows={5} cols={5} onChange={(e)=>onUpdate(e.target.value)}/>
            </div>
            <div>
              <label htmlFor="techcertificates">Tech Certifications</label>
              <textarea id="techcertificates" rows={5} cols={5} onChange={(e)=>onUpdate(e.target.value)}/>
            </div>
            <div>
              <label htmlFor="otherprojects">Contribution to other Projects</label>
              <textarea id="otherprojects" rows={5} cols={5} onChange={(e)=>onUpdate(e.target.value)}/>
            </div>
            <div>
              <label htmlFor="anyother">Anything else</label>
              <textarea id="anyother" rows={5} cols={5} onChange={(e)=>onUpdate(e.target.value)}/>
            </div>
            </Form>

        </div>
    );
}

export default TechnicalShowcase;
